import React from 'react';
import './App.css';

function Line(props) {
  return (
          <div className="line">
          <div className="conbination">
                <div className={"case-combination" + props.line[0][0]}></div>
                <div className={"case-combination" + props.line[0][0]}></div>
                <div className={"case-combination" + props.line[0][0]}></div>
                <div className={"case-combination" + props.line[0][0]}></div>
          </div>
            <div className="result">
            <div className="case-result"></div>
            <div className="case-result"></div>
            <div className="case-result"></div>
            <div className="case-result"></div>
            </div>
          </div>
  );
}

export default Line;
